import React, { useState } from 'react';
import { Link, NavLink } from 'react-router-dom';

import menu from './../data/menu';



function Dropdown() {
  const [isOpen, setIsOpen] = useState(false);
  const handleOpen = () => setIsOpen(!isOpen);

  return (
		<>
				{
					menu.map(m => (
						<li key={m.id} className={m.children ? 'dropdown' : ''}>
							{ !m.children ? (
								<Link to={m.path}>
									{m.name}
								</Link> ) : (
								<>
									<Link to={m.path} onClick={handleOpen}>
										<span>{m.name}</span>
										{ !isOpen ?
											(<i className="bi bi-chevron-down"></i>)
											:
											(<i className="bi bi-chevron-right"></i>)
										}
									</Link>

									{isOpen ? (<ul className={isOpen ? "dropdown-active" : null}>
										{
											m.children.map(mc => { !mc.children ? (
													<li key={mc.id}>
														<Link to={mc.path}>{mc.name}</Link>
													</li>
											) : (
														<><li key={mc.id}>
															<Link to={mc.path} onClick={handleOpen}>
																<span>{mc.name}</span>
																{ isOpen ?
																	(<i className="bi bi-chevron-down"></i>)
																	:
																	(<i className="bi bi-chevron-right"></i>)
																}
															</Link>
														</li>
														{
															isOpen ?
															(
															<ul className={isOpen ? "dropdown-active" : ""}>
																{
																	mc.children.map(mcc => (<li><Link>{mcc.name}</Link></li>))
																}
															</ul>
															) : (<></>)
														}</>
													)
											}
										)
									}
									</ul>) : <></>}
								</>
								)}
						</li>
	 	 		  ))
	 	 		}
		</>
	)
}

function Navbar() {
	const [toggle, setToggle] = useState(false);
  const handleToggle = () => setToggle(!toggle);

	return (
		<nav id="navbar" className={!toggle ? "navbar" : "navbar navbar-mobile"}>
			<ul>
				<Dropdown />
			</ul>
			{ !toggle ?
 				(<i onClick={handleToggle} className="bi mobile-nav-toggle bi-list"></i>)
				:
				(<i onClick={handleToggle} className="bi mobile-nav-toggle bi-x"></i>)
			}
		</nav>
	)
}

function Header() {
	return (
  	<header id="header" className="fixed-top d-flex align-items-center">
			<div className="container d-flex align-items-center justify-content-between">
				<div className="logo">
					<h1 className="text-light">
						<NavLink
							to="/"
							className={({ isActive, isPending }) =>
    isPending ? "pending" : isActive ? "active" : ""
  }
						>Serenity</NavLink>
					</h1>
					{/*<Link to="/">
						<img src="../assets/img/logo.png" alt="" className="img-fluid" />
					</Link>*/}
				</div>
				<Navbar />
			</div>
		</header>
	)
}

export default Header;


